def solve():
    s = "t32 t19 t19 t0 t77"

    def is_valid(grammar, string):
        try:
            graph = build_graph(grammar)
            for symbol in string:
                if symbol not in graph:
                    return False
            return True
        except Exception as e:
            print(f"Error: {e}")
            return False

    def build_graph(grammar):
        graph = {}
        for entry in grammar:
            if isinstance(entry, str):
                graph[entry] = []
            elif isinstance(entry, tuple):
                graph[entry[0]] = []
                graph[entry[1]] = []
            else:
                return None

        return graph

    def generate(graph, current_string):
        if current_string == "t32 t19 t19 t0 t77":
            return True

        if not graph:
            return False

        for symbol in graph:
            if isinstance(graph[symbol], list):
                for sub_symbol in graph[symbol]:
                    if generate(graph, current_string + sub_symbol):
                        return True
            else:
                if isinstance(graph[symbol], str):
                    if generate(graph, current_string + graph[symbol]):
                        return True
        return False

    if generate(build_graph(s), ""):
        print("Yes")
    else:
        print("No")

solve()
